import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { data } from './Books-data';
import Book from './Book';


//Setup Vars


function BookList() {
    return (
        <>
            <section className='booklist'>

                {data.map((book) => {
                    return <Book key={book.id} book={book}></Book>;
                })}

            </section>
        </>
    )
}




ReactDOM.render(
    <>
        <BookList />

    </>

    ,
    document.getElementById('root')
)
